import {Injectable} from "@angular/core";

@Injectable({
                providedIn: "root"
            })
export class LogoService
{
    // Base64 generated through https://www.base64-image.de/

    // Source: assets/branding/logo-color-150-tall.png
    private static readonly logoColor150Tall = `data:image/png;base64,`;

    // Source: assets/branding/logo-powered-by.png
    private static readonly logoPoweredBy = `data:image/png;base64,`;
    get color150Tall()
    {
        return LogoService.logoColor150Tall;
    }

    get poweredBy()
    {
        return LogoService.logoPoweredBy;
    }
}
